package com.vmetrix.v3.logsmanagement.model;import java.io.Serializable;import java.time.LocalDateTime;import java.util.List;import javax.persistence.Column;import javax.persistence.Entity;import javax.persistence.GeneratedValue;import javax.persistence.GenerationType;import javax.persistence.Id;import javax.persistence.OneToMany;import javax.persistence.SequenceGenerator;import javax.persistence.Table;/** *  * Entity representation of TB_LG_SETTING * */@Entity@Table(name = "TB_LG_SETTING")public class LogSetting implements Serializable {	/**	 * 	 */	private static final long serialVersionUID = -406695394107708588L;	@Id	@SequenceGenerator(name = "CD_SEQ_LOGSET", sequenceName = "SQ_TBLGSETTING_CDSEQLOSET", allocationSize = 1)	@GeneratedValue(strategy = GenerationType.SEQUENCE, generator = "CD_SEQ_LOGSET")	@Column(name = "CD_SEQ_LOGSET", nullable = false)	private Long id;	@OneToMany(mappedBy = "setting")	private List<LogLevelConf> levelConfList;	@Column(name = "QT_SIZESYSTEM")	private Integer sizeSystem;	@Column(name = "QT_SIZECUSTOM")	private Integer sizeCustom;	@Column(name = "QT_DELDAYS")	private Integer deldays;	@Column(name = "NM_CREATE_USER", length = 15)	private String nameCreateUser;	@Column(name = "DT_CREATE")	private LocalDateTime dateCreate;	@Column(name = "NM_UPDATE_USER", length = 15)	private String nameUpdateUser;	@Column(name = "DT_UPDATE")	private LocalDateTime dateUpdate;	public Long getId() {		return id;	}	public void setId(Long id) {		this.id = id;	}	public Integer getSizeSystem() {		return sizeSystem;	}	public void setSizeSystem(Integer sizeSystem) {		this.sizeSystem = sizeSystem;	}	public Integer getSizeCustom() {		return sizeCustom;	}	public void setSizeCustom(Integer sizeCustom) {		this.sizeCustom = sizeCustom;	}	public Integer getDeldays() {		return deldays;	}	public void setDeldays(Integer deldays) {		this.deldays = deldays;	}	public List<LogLevelConf> getLevelConfList() {		return levelConfList;	}	public void setLevelConfList(List<LogLevelConf> levelConfList) {		this.levelConfList = levelConfList;	}	public String getNameCreateUser() {		return nameCreateUser;	}	public void setNameCreateUser(String nameCreateUser) {		this.nameCreateUser = nameCreateUser;	}	public LocalDateTime getDateCreate() {		return dateCreate;	}	public void setDateCreate(LocalDateTime dateCreate) {		this.dateCreate = dateCreate;	}	public String getNameUpdateUser() {		return nameUpdateUser;	}	public void setNameUpdateUser(String nameUpdateUser) {		this.nameUpdateUser = nameUpdateUser;	}	public LocalDateTime getDateUpdate() {		return dateUpdate;	}	public void setDateUpdate(LocalDateTime dateUpdate) {		this.dateUpdate = dateUpdate;	}}